function showTable(name, gender)
{ // AJAX
	if (name=="")
	  {
	  document.getElementById("txtHint").innerHTML="";
	  return;
	  } 
	if (window.XMLHttpRequest)
	  {// code for IE7+, Firefox, Chrome, Opera, Safari
	  xmlhttp=new XMLHttpRequest();
	  }
	else
	  {// code for IE6, IE5
	  xmlhttp=new ActiveXObject("Microsoft.XMLHTTP");
	  }
	xmlhttp.onreadystatechange=function()
	  {
	  if (xmlhttp.readyState==4 && xmlhttp.status==200)
		{
		document.getElementById(name).innerHTML=xmlhttp.responseText;
		document.getElementById(name).style.visibility="visible";
		}
	  }
	if(name!="Size") {
		xmlhttp.open("GET","getNames.php?name="+name+"&gender="+gender,true);
		xmlhttp.send();
	}
	else {
		var gender = document.getElementById("selectedGender");
		var brand = document.getElementById("selectedBrand");
		var type = document.getElementById("selectedType");
		
		var callString = encodeURI("getSizeNames.php?"+
						"gender="+gender.innerHTML +
						"&brand="+brand.innerHTML +
						"&type="+type.innerHTML);
		//alert(callString);
		xmlhttp.open("GET", callString,true);
		xmlhttp.send();
	}
}


