function checkCartForm() {
	
	// Get form elements
	var submitButton = document.getElementById("submitCartForm");
	var fname = document.getElementsByName("fname")[0];
	var lname = document.getElementsByName("lname")[0];
	var email = document.getElementsByName("email")[0];
	var payPaypal = document.getElementById("payment_paypal");
	var payUeberweisung = document.getElementById("payment_ueberweisung");
	var blz = document.getElementById("blz");
	var kto = document.getElementById("kto");
	var ppSame = document.getElementById("paypalMail1");
	var ppDifferent = document.getElementById("paypalMail2");
	var ppMail = document.getElementById("paypalMailadress");
	
	$(".ueberweisung").hide();
	$(".paypal").hide();
	$(".paypal_Mailadress").hide();
	
	// Check Ueberweisung
	if(payUeberweisung.checked) {
		$(".ueberweisung").show();
		$(".paypal").hide();
	}
	// Check paypal
	else if(payPaypal.checked) {
		$(".paypal").show();
		$(".ueberweisung").hide();
		
		if(ppDifferent.checked ) {
			$(".paypal_Mailadress").show();
		}
		else {
			$(".paypal_Mailadress").hide();
		}

	}
	else {
		$(".ueberweisung").hide();
		$(".paypal").hide();
	}

}

function checkRejectionForm() {
	
	// Get form elements
	var sumField = document.getElementById("transactionSum");
	var newSumDiv = document.getElementById("newSumDiv");
	var sumDiv = document.getElementById("sumDiv");
	var sumFieldNew = document.getElementById("transactionSumNew");
	var sendBack = document.getElementById("reject_sendBack");
	var charity = document.getElementById("reject_charity");
	var submitButton = document.getElementById("rejectionSubmit");
	var negativeSum = document.getElementById("negativeSum");
	var finalToPay = document.getElementById("finalToPay");
	var sum = sumField.innerHTML;
	
	// Check Rejectoption
	if(sendBack.checked) {
		
		var newSum = sum - 5;
		finalToPay.value = newSum;
		sumFieldNew.innerHTML = sum + " â‚¬ - 5 â‚¬ shipping costs = " + newSum;
		newSumDiv.removeAttribute("hidden");
		sumDiv.setAttribute("hidden", "hidden");
		if(newSum<0){
			negativeSum.removeAttribute("hidden");
		}
	}
	else if(charity.checked) {
		finalToPay.value = sum;
		newSumDiv.setAttribute("hidden", "hidden");
		negativeSum.setAttribute("hidden", "hidden");
		sumDiv.removeAttribute("hidden");
	}
	else {
		submitButton.setAttribute("disabled", "disabled");
		return;
	}
	
	submitButton.removeAttribute("disabled");
}

 
